import React from "react";

function Skills() {
  return (
    <div>
      <h1>Skills</h1>
      <ul>
        <li>React</li>
        <li>JavaScript</li>
        <li>TypeScript</li>
        <li>PHP</li>
      </ul>
    </div>
  );
}

export default Skills;
